
// 1674. Minimum Moves to Make Array Complementary
// https://leetcode.com/problems/minimum-moves-to-make-array-complementary/

// delivers correct results, but TLE

#include <iostream>
#include <cassert>
#include <chrono>
#include <vector>
#include <unordered_set>
#include <unordered_map>
#include <array>
#include <climits>
#include <algorithm>

using namespace std;

chrono::time_point<chrono::system_clock> tstart;
chrono::time_point<chrono::system_clock> tend;
chrono::duration<double> elapsed_seconds;

class Solution {
public:
    int minMoves(vector<int>& nums, int limit) {
        size_t n = nums.size();
        if( n == 2 ) return 0;
        int n2 = n/2;

        tstart = chrono::system_clock::now();
        unordered_map<int,int> sums;
        pair<unordered_map<int,int>::iterator,bool> p;
        int a,b,t,oneMoveMin,oneMoveMax;
        array<int,3> w[n2];
        int mx = 0, mn = 100001;
        for(int i = 0; i < n2; ++i) {
            a = nums[i];
            b = nums[n-1-i];
            t = a + b;
            mn = min(mn,t);
            mx = max(mx,t);
            p = sums.insert({t,1});
            if( !p.second ) ++p.first->second;
            oneMoveMax = max(a,b) + limit;
            oneMoveMin = min(a,b) + 1;
            w[i] = {t,oneMoveMax,oneMoveMin};
        }
        tend = chrono::system_clock::now();
        elapsed_seconds = tend - tstart;
        cout << "elapsed_seconds " << elapsed_seconds.count() << endl;
        if( mn == mx ) return 0;

        tstart = chrono::system_clock::now();
        vector<pair<int,int>> v(sums.begin(),sums.end());
        sort(v.begin(),v.end(),[](const pair<int,int>& a, const pair<int,int>& b){
            return a.second > b.second;
        });
        tend = chrono::system_clock::now();
        elapsed_seconds = tend - tstart;
        cout << "elapsed_seconds " << elapsed_seconds.count() << endl;

        tstart = chrono::system_clock::now();
        int ans = 2*n;
        int r;
        int T;
        for(auto it = v.begin(); it != v.end(); ++it) {
            // best case scenario is that all pairs where sum does not match only need 1 move
            // if we already found an answer lower than that, we can skip this sum
            if( n2 - it->second >= ans ) continue;
            T = it->first;
            r = 0;
            for(int i = 0; i < n2; ++i) {
                t = w[i][0];
                if( t < T ) {
                    // we need to increase a or b or both
                    r += w[i][1] < T ? 2 : 1;
                } else if( t > T ) {
                    // we need to decrease a or b or both
                    r += w[i][2] > T ? 2 : 1;
                }
            }

            ans = min(ans,r);
        }
        tend = chrono::system_clock::now();
        elapsed_seconds = tend - tstart;
        cout << "elapsed_seconds " << elapsed_seconds.count() << endl;

        return ans;
    }
};

